import React from 'react';
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import MainPage from './pages/main.js';
import {Routes, Route} from 'react-router-dom';

function App() {
  return (
    <Routes>
			<div className="main">
			<MainPage />
		</div>
		</Routes>
  );
}

export default App;
